script: |
  super -f text -I q13619.spq | sort > q13619.out

inputs:
  - name: q13619.spq
    data: |
      SELECT + 95 / - col0 AS col0 FROM tab1 (FORMAT parquet) WHERE + col1 / - ( 75 ) + 14 NOT IN ( col0 / - col1 );
  - name: tab1

outputs:
  - name: q13619.out
    data: |
      -1
      -1
      -1
